import React from 'react';
import { Link } from 'react-router-dom';
function Header(){

    return (
<div className="main-header">
<ul>
    <Link to="/">Home</Link>
<li>Home</li>
<li>About</li>
</ul>
</div>

    );
}

export default Header;
